(479, 479, 'วันที่ 31 มีนาคม 2564 เดินทางจากสกลนครไปยัง อ.พระทองคำ จ.นครราชสีมา ให้ระหว่างเดินทางได้แวะ 1100 จอด ปตท. สมเด็จ \r\n1300 จอดกินข้าวที่ ลำชี  2 \r\n1700 ถึง ที่ว่าการอำเภอพระทองคำ', 'วันที่ 1 เม.ย.64 คัดเลือกทหารกองเกินที่ อ.พระทองคำ\r\n1600 เดินทางไปยัง อ.โนนไทย \r\n1700 ถึง อ.โนนไทย โดยพักที่วัดป่าหลักร้อย', 'วันที่ 2 เม.ย. 64 คัดเลือกทหารกองเกินที่ วัดป่าหลักร้อย อ.โนนไทย\r\n1700 เข้าไปฝากเงินที่ ธ.กรุงไทยและไปโลตัส ในตัวเมือง อ.โนนไทย\r\nแล้วกลับที่พัก วัดป่าหลักร้อย', 'วันที่ 3 เม.ย.64 คัดเลือกทหารกองเกินที่ วัดป่าหลักร้อย อ.โนนไทย\r\n1500 เดินทางไปยัง อ.วังน้ำเขียว \r\n1700 ถึงที่ว่าการอำเภอวังน้ำเขียว', 'วันที่ 4 เม.ย.64 คัดทหารกองเกินที่ อ.วังน้ำเขียว\r\n1500 เดินทางไปยัง อ.ปักธงชัย\r\n1600 ถึงที่พักที่ว่าการอำเภอปักธงชัย', 'วันที่ 5 เม.ย.64 คัดเลือกทหารกองเกินที่ อ.ปักธงชัย \r\n2000 ไปกินข้าวที่ร้านเนื้อย่างทะเลเผา\r\n2200 เดินทางกลับที่พักที่ หอประชุมที่ว่าการอำเภอปักธงชัย', 'วันที่ 6 เม.ย.64 \r\n0700 เดินไปกินข้าวหน้าที่ว่าการอำเภอปักธงชัย\r\nหลังจากนั้นอยู่ที่พักที่หอประชุมอำเภอปักธงชัย', 'วันที่ 7 เม.ย.คัดทหารกองเกินที่ อ.ปักธงชัย\r\nแล้วก็อยู่แต่ที่พัก', 'วันที่ 8 เม.ย.64 คัดทหารกองเกินที่ อ.ปักธงชัย\r\n1500 เดินทางไปยัง อ.เสิงสาง \r\n1700 ถึง อ.เสิงสาง แล้วเดินไปซื้อกับข้าวที่ตลาดในตัวอำเภอแล้วก็กลับที่พัก', 'วันที่ 9 เม.ย. คัดทหารกองเกินที่ อ.เสิงสาง\r\n1900 ออกไปกินเนื้อย่างหน้าที่ว่าการอำเภอเสิงสางแล้วก็กลับที่พัก', 'วันที่ 10 เม.ย.64 คัดทหารกองเกินที่ อ.เสิงสาง \r\n1500 เดินทางไปยัง อ.ครบุรี \r\n1700 ถึงที่พักที่หอประชุมอำเภอครบุรี\r\n1900 ออกไปทานข้าวที่ตลาดหน้าที่ว่าการอำเภอครบุรี', 'วันที่ 11 เม.ย.64 คัดทหารกองเกินที่ อ.ครบุรี\r\n1730 เดินทางกลับ จ.สกลนคร', NULL, NULL, '2021-04-11 10:21:56', '2021-04-11 10:21:56'),
