(494, 494, '29 มี.ค.64\r\nอยู่ที่ทำงาน รพ.ค่ายกฤษณ์สีวะรา กับที่บ้านพักหลังรพ.', '30 มี.ค.64\r\nอยู่ที่ทำงาน รพ.ค่ายกฤษณ์สีวะรา กับที่บ้านพักหลังรพ.', '31 มี.ค.64\r\nอยู่ที่ทำงาน รพ.ค่ายกฤษณ์สีวะรา กับที่บ้านพักหลังรพ.', '1 เม.ย.64\r\nอยู่ที่ทำงาน รพ.ค่ายกฤษณ์สีวะรา กับที่บ้านพักหลังรพ.', '2 เม.ย.64\r\nอยู่ที่ทำงาน รพ.ค่ายกฤษณ์สีวะรา กับที่บ้านพักหลังรพ.', '3 เม.ย.64\r\n08.30 น. เดินทางกลับบ้าน อ.สัตหีบ จ.ชลบุรี โดยเครื่องบินจากสกลนครไปลงดอนเมืองเเละเดินทางโดยรถยนต์ส่วนตัวกลับบ้าน เเวะซื้อน้ำร้านอเมซอน สาขาบ้านฉาง ก่อนกลับบ้านเเวะทานข้าวที่บ้านฉาง', '4 เม.ย. 64\r\nอยู่บ้านทั้งวันไม่ได้ไปไหน', '5 เม.ย.64\r\nประมาน 14.00 น. ไปหาพี่ๆห้องเเลบที่รพ.สมเด็จพระนางเจ้าสิริกิต เดินทางโดยรถส่วนตัว \r\nช่วงเย็นประมาน 18.30 น. ไปทานข้าวร้านมุมอร่อย sliver lake  (ร้านเป็นเเบบ open air) กลับประมาณ 19', '6 เม.ย. 64\r\nเวลาประมาน 12.00 น. ซื้อกาเเฟที่ร้านอเมซอน สาขาบ้านฉาง เเละเวลาประมาน 14.00 น. ไปไหว้พระที่วัดละหารไร่ จ.ระยอง (ในวัดคนไม่เยอะ เเละสวมเเมสตลอดเวลาที่อยู่ที่วัด) จากนั้นเดินทางกลับ', '7 เม.ย. 64\r\n16.00 น.ไปหาคุณครูที่บ้านพัก ฐานทัพเรือ อาภากร สัตหีบ\r\n19.00 น. ไปทานอาหารที่ร้านยองจู ร้านอาหารเกาหลี\r\n(ในร้านมีอยุเเค่ 1 โต๊ะ)', '8 เม.ย.64\r\n11.00 น.เดินทางไปอยุธยาโดยรถยนต์ส่วนตัว\r\n13.30 น. เเวะทานข้าวปั๊ม ปตท.อยุธยา ร้านเย็นตาโฟมัลลิกา (มีคนอยุประมาน 3 โต๊ะ นั่งห่างๆกัน)\r\n14.20 - 14.45น. เเวะพิพิธภัณฑ์เจ้าสามพระยา ( ค', '9 เม.ย.64\r\n13.30-14.30 น. ทานไอติมร้าน great and grand คนไม่เยอะ ร้านอยุนอกเมือง สายนอก 331\r\n15.00 - 16.00 น. ทานข้าวร้านร่มสน (นั่งอยุเเค่โต๊ะเดียว)\r\n16.40 น. ไปทำบุญปล่อยปลาที่วัดญาณ บริเวณ', '10 เม.ย.64\r\n10.00 - 15.40 น.ไปรับน้องกลับบ้านที่บ้านญาติปากเกร็ด นนทบุรี โดยรถยนต์ส่วนตัว (ไม่ได้เเวะไหนรับเเล้วกลับทันที) \r\nปล.น้องไม่มีประวัติสัมผัสกับผู้ที่มีความเสี่ยงหรือผู้ป่วยที่ได้รับ', '11 เม.ย. 64\r\n12.00 น.เดินทางจากบ้านอำเภอสัตหีบ ไปสนามบินดอนเมืองโดยรถยนต์ส่วนตัว\r\n14.30 - 14.50 น. เเวะกินข้าวร้านโกเบ๊ (ซอยทางเข้า ม.รังสิต) ร้านเป็น open air  คนไม่เยอะมีอยุ 2-3 โต๊ะ นั่งห่', '2021-04-11 12:59:56', '2021-04-11 12:59:56'),
