(506, 506, '29 มี.ค. 64\r\n- ปฏิบัติงานที่หน่วย ร.3 พัน.1', '30 มี.ค. 64\r\n- ปฎิบัติงานที่หน่วย ร.3 พัน.1', '31 มี.ค. 64\r\n- ออกจากบ้านพัก ร.3 พัน.1 สกลนคร\r\n- เติมน้ำมัน ซื้อกาแฟ อเมซอล ปั้ม ปตท.ทางขึ้นภูพาน\r\n- เดินทางไปรับที่ตรวจหาสารเสพติดที่ สำนักงาน ปปส. จ.ขอนแก่น\r\n- เดินทางไปรับของที่ร้าน พ.มิตร', '1 เม.ย. 64\r\n- ออกจากที่พักแก้วมังกรรีสอร์ท อ.พระทองคำ จ.นครราชสีมา\r\n- คัดเลือกทหาร อ.พระทองคำ\r\n- เดินทางไปยัง อ.โนนไทย เบ้าที่พักชายทุ่งรีสอร์ท\r\n- ซื้อของที่โลตัส อ.โนนไทย\r\n- ทานข้าวกับชุดตรว', '2 เม.ย. 64\r\n- ออกจากที่พักชายทุ่งรีสอร์ท\r\n- คัดเลือกทหารที่วัดป่าหลักร้อย อ.โนนไทย วันที่ 1 \r\n- แวะกดเงินที่ ตู้ ATM ธ.กรุงไทย อ.โนนไทย\r\n- กลับที่พักชายทุ่งรีสอร์ท\r\n- ทานก๋วยเตี๋ยวหน้า เทศบาล', '3 เม.ย. 64\r\n- ออกจากที่พักชายทุ่งรีสอร์ท อ.โนนไทย\r\n- คัดเลือกทหารที่ วัดป่าหลักร้อย อ.โนนไทย วันที่ 2\r\n- เดินทางไป อ.วังน้ำเขียว\r\n- ทานข้าวเย็นที่ร้านข้าวต้ม อ.วังน้ำเขียว กับคณะ 3 คน\r\n- เข้า', '4 เม.ย. 64\r\n- คัดเลือกทหารที่ อ.วังน้ำเขียว\r\n- เดินทางไป อ.ปักธงชัย เข้าที่พัก เทพกมลรีสอร์ท อ.ปักธงชัย\r\n- ทานข้าวที่ร้านนิดผัดหมี่ ปักธงชัย\r\n- กลับที่พัก', '5 เม.ย. 64\r\n-ออกจากที่พักเทพกมลรีสอร์ท\r\n-คัดเลือกทหาร อ.ปักธงชัย วันที่ 1 \r\n- รับผ้าที่ส่งซักที่ร้าน ซัก รีด หลังที่ว่าการอำเภอปักธงชัย\r\n- กลับที่พักเทพกมลรีสอร์ท\r\n- ทานข้าวกับชุดนรวจเลือกด้ว', '6 เม.ย. 64\r\n- ออกจากที่พักเทพกมลรีสอร์ท\r\n- ตีกอล์ฟที่สนามกอล์ฟค่ายสุรนารี (นักกอล์ฟ 6 แคดดี้ 6)\r\n- กลับที่พักเทพกมลรีสอร์ท อ.ปักธงชัย\r\n- ทานข้าวเย็นที่ร้านหมูกะทะปากทางเข้าที่พัก\r\n- กลับที่พั', '7 เม.ย. 64\r\n- ออกจากที่พักเทพกมลรีสอร์ท อ.ปักธงชัย\r\n- คัดเลือกทหาร อ.ปักธงชัย วันที่ 2\r\n- กลับที่พักเทพกมลรีสอร์ท\r\n- ทานข้าวเย็นกับคณะ 7 คนที่ร้านแจ่งฮ้อนคลาสสิคปักธงชัย\r\n- กลับที่พัก', '8 เม.ย. 64\r\n- ออกจากที่พักเทพกมลรีสอร์ท อ.ปักธงชัย\r\n- คัดเลือกทหาร อ.ปักธงชัย วันที่ 3\r\n- เดินทางไป อ.เสิงสาง เข้าที่พัก ป๊อกทัวร์รีสอร์ท\r\n- ทานก๋วยเตี๋ยวไก่ แยกไฟแดง อ.เสิงสาง\r\n- กลับที่พัก', '9 เม.ย. 64\r\n- ออกจากที่พัก ป๊อกทัวร์รีสอร์ท ต.เสิงสาง อ.เสิงสาง\r\n- ซื้อกาแฟที่ 7-11 แนกไฟแดง ต.เสิงสาง อ.เสิงสาง\r\n- คัดเลือกทหาร อ.เสิงสาง จ.นครราชสีมา\r\n- ซื้ออาหารที่ 7-11 แยกไฟแดง ต.เสิงสาง', '10 เม.ย. 64\r\n-คัดเลือกทหารที่ อ.เสิงสาง จ.นครราชสีมา\r\n- เดินทางมา อ.ครบุรี จองที่พักให้ คณะตรวจเลือก ที่ บ้านพักถวิล อ.ครบุรี\r\n- เดินทางกลับบ้านที่ ต.จระเข้หิน อ.ครบุรี \r\n- มาทานข้าวที่ ร้าน ', '11 เม.ย. 64\r\n- คัดเลือกทหาร หอประชุม อ.ครบุรี จ.นครราชสีมา\r\n- กลับบ้านเก็บของที่ ต.จระเข้หิน  อ.ครบุรี จ.นครราชสีมา \r\n- เดินทางกลับสกลนคร ใช้เส้นทางบุรีรัมย์ มหาสารคาม โดยแวะทานก๋วยเตี๋ยวที่ ', '2021-04-12 00:29:48', '2021-04-12 00:29:48'),
