(536, 536, 'วันที่5  เม.ย. ที่ทำงานรพ.ค่ายกฤษณ์สีวะรา\r\nเวลา13.00น.ถึง16.00น. แถลงแผนรับเสด็จที่สวนบัวเฉลิมพระเกียรติ ใส่แมสตลอดเวลา', 'วันที่6 ทำโรงทานที่วัดหลวงปู่บุญหนาพร้อมคณะแม่บ้าน เวลา 05.30น.ถึง09.00น.\r\nหลังจากนั้นอยู่บ้าน และเวลา 17.00น.ถึง21.00น. รับคณะภริยาแม่ทัพ สวมแมสตลอดกิจกรรม', 'วันที่7เม.ย. เวลา07.00ถึง 21.00น.ชุดแพทย์รับเสด็จราชินี ที่สวนบัวเฉลิมพระเกียรติ สวมแมสตลอด', 'วันที่8เม.ย.64 เวลา 07.00นถึง09.00น. ส่งคณะภริยาแม่ทัพที่เรือนรับรอง มทบ.29\r\n09.00-11.00น. รับประทานอาหารที่ร้านฟ้าโปร่งพร้อมคณะแม่บ้าน\r\n11.00น.ถึง12.30น. นำผ้าไปตัดชุดแม่บ้านที่ร้าน แฮริช สก', 'วันที่9เ.ย.64 07.00น.ถึง12.00น. ออกหน่วยแพทย์เกณฑ์ทหาร  ที่อำเภอโพนนาแก้ว สวมแมสตลอดเวลา\r\n13.00ถึง16.00น.อยู่ที่ทำงานรพ.ค่ายฯ สมวแมสตลอดเวลา\r\n18.00ถึง21.00น ขับรถส่ในตัวพร้อมสามีเดินทางไปจ.ขอ', 'วันที่10เม.ย. 06.00ถึง21.00 น อยุ่บ้านกับพ่อ แม่ สามีและลูกสาว ไม่ได้ออกไปไหน', 'วันที่11 เม.ย. เวลา06.00ถึง2100นอยุ่บ้านไม่ได้ออกไปไหน', 'วันที่12เม.ย. อยู่บ้าน ไม่ได้ออกไปไหน', 'วันที่13เม.ย. อยู่บ้านไม่ได้ออกไปไหน', 'วันที่14เม.ย. อยุ่บ้าน ไม่ได้ออกไปไหน', 'วันที่15เม.ย. เดินทางกลับสกลนครโดยรถยนต์ส่วนตัว ไม่ได้แวะพักที่ไหน', 'ที่ทำงานรพ.ค่ายกฤษณ', 'ที่ทำงานรพ.ค่ายกฤษณ์', 'ที่ทำงานรพ.ค่ายกฤษณ์', '2021-04-15 13:08:25', '2021-04-15 13:08:25'),
