(553, 553, 'วันที่ 2 เมษายน ทำงานที่โครงการส่งเสริมศิลปาชีพ บ้านบ่อเดือนห้า', 'วันที่ 3 เมษายน จัดของเตรียมรับเสด็จอยู่ที่พัฒนาการอำเภอภูพาน', 'วันที่ 4 เมษายน จัดของเตรียมรับเสด็จ ที่โครงการบ้านบ่อเดือนห้า', 'วันที่ 5 เมษายน เวลา 07.00 น เดินทางไป ส่งรูปที่โรงเรียนเซนต์ยอแซฟสกลนคร เวลา 09.00 นเดินทาง ไปที่ศูนย์ส่งเสริมศิลปาชีพบ้านกุดนาขามตำบลเจริญศิลป์ อำเภอเจริญศิลป์', 'วันที่ 6 เมษายนจัดเตรียมสถานที่ เพื่อเตรียมรับเสด็จ ณศูนย์ศิลปาชีพบ้านกุดนาขาม', 'วันที่ 7 เมษายน รับเสด็จ ศูนย์ส่งเสริมศิลปาชีพบ้านกุดนาขาม', 'วันที่ 8 เมษายน ขนของ กลับ จากโครงการส่งเสริมศิลปาชีพบ้านกุดนาขาม\r\nเวลา 11:00 น กลับมาถึงโครงการบ้านบ่อเดือนห้า', 'วันที่ 9 เมษายน เวลา 07.00 น ร่วมกิจกรรม รับ ประกาศนียบัตรจบอนุบาล 3 อยู่ที่โรงเรียนเซนยอ\r\nไปทำบุญที่วัดพระธาตุเชิงชุมเวลา 0900\r\nเดินทางกลับมาทำงานที่โครงการบ้านบ่อเดือนห้า', 'วันที่ 10 เมษายน เดินทางไปรับ พวงหรีดพัดลม ที่ร้าน พิกุลทอง\r\nเวลา 14:00 น เดินทางไปร่วมงานศพมารดาครูสอนสาวไหมที่บ้านสร้างค้อหมู่ 2 ตำบลสร้างค้ออำเภอภูพาน', 'วันที่ 11 เมษายน เดินทางไปบ้าน กกส้มโฮง ซอยยศทอง\r\nเวลา 13.00 นเดินทางไปซื้ออ่างน้ำ อยู่ที่โรบินสัน เวลา 15.00 นเดินทางกลับบ้าน', 'วันที่ 12 เมษายน พักอยู่ที่บ้าน กกส้มโฮง', 'วันที่ 13 เวลา 14.00 น ตรวจเยี่ยมด่านชุมชนบ้านภูพานบ่อเดือนห้าตำบลโคกภูอำเภอภูพาน', 'วันที่ 14 รดน้ำดำหัว แม่และผู้สูงอายุอยู่ที่วัดภูเงินเวฬุวัน\r\nตำบลสร้างค้ออำเภอภูพาน', 'วันที่ 15 เมษายน อยู่ที่วัดภูเงินเวฬุวันตำบลสร้างค้ออำเภอภูพาน', '2021-04-16 04:13:15', '2021-04-16 04:13:15'),
