(555, 555, ',13เม.ย.64ออกเดินทางเวลา07.00น.แวะป้ัมน้ำมันเข้าห้องน้ำเข้าเช่เว่นป้ัมสมเด็จเวลาประมาณ09.00น..หลังจากนั้นเดืนทางตรงไปบ้านถึงย่าเวลา11.30นบ่ายๆ14.30ไปตลาดกลับเวลา16.30น.หลังจากนั้นอยู่บ้าน', '14เมย.07.30น.ไปทำบุญตักบาตรที่วัดป่าบ้านศิลาอ.เมืองจ.ขอนแก่นกลับจากวัดเวลา09.00น.หลังจากนั้นกลับบ้านย่ารับประทานข้าวเช้ากับญาติหลังจากนั้นเวลา15.00น.ไปโรตัสชื้อของใช้กลับเวลา6.00นไม่ได้ออกไปไ', '15เมย.07.00นแวะย้าน้พื่อนบ้านเต่านอ1ชม.หลังจากนั้นเดินทางกลับเวลา07.30นแวะเข้าห้องน้ำป้ัมน้ำมันกาฬสินธ์ุเวลา.9.30น.หลังจากนั้นเดินทางกลับสกลนครถึง11.30น.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-16 05:11:05', '2021-04-16 05:11:05'),
