(567, 567, '0830ไปทำงาน รพ.ค่าย\r\n1200กลับบ้านพัก\r\n1330ไปทำงาน\r\n1600กลับบ้านพัก', '0830ไปทำงาน รพ.ค่าย\r\n1200กินข้าวร้านลี้แซบ\r\n1330ไปทำงาน\r\n1600กลับอุดรธานีโดยรถยนต์ส่วนตัว', 'อยู่บ้านพักค่ายประจักษ์ทั้งวัน', '1200ไปส่งลูกเรียนพิเศษ ครูเภา\r\n1500รับลูก\r\n1500ขับรถยนต์ส่วนตัวไปบ้านสวนที่อำเภอกุมภวาปี\r\n1900กลับบ้านพักค่ายประจักษ์', '0500ขับรถกลับสกลนครโดยรถยนต์ส่วนตัวไม่ได้จอด\r\n0800รวมแถว\r\n0830ทำงาน\r\n1200กินข้าวกับเพือนที่บิ๊กซีสกลนคร\r\n1300กลับที่ทำงาน\r\n1600กลับอุดรธานีโดยรถส่วนตัว\r\n1900ถึงอุดรธานี', 'อยู่บ้านพักที่ค่ายประจักษ์ทั้งวัน', '0600เดินทางกลับสกลโดยรถยนต์ส่วนตัว\r\n0830ถึงที่ทำงาน\r\n1200กินส้มตำ\r\n1230กินกาแฟอเมซอนสาขาบขส.\r\n1330ที่ทำงาน\r\n1600บ้านพัก', '0830ทำงาน\r\n1200ก๋วยเตี๋ยวโกเหลียง\r\n1300ที่ทำงาน\r\n1600กลับบ้านพัก', '0830ทำงาน\r\n1200ส้มตำลี้แซบ\r\n1330ที่ทำงาน\r\n1600กลับอุดรโดยรถยนต์ส่วนตัว', '1300กลับบ้านสวนกุมภวาปี\r\n1315เติมน้ำมัน ปตท.บ้านจั่น\r\n1400ถึงบ้านสวนไม่ได้ไปไหน\r\n1900กลับบ้านพักค่ายประจักษ์', '1100กลับกุมภวาปี\r\n1200ซื้อข้าวมันไก่ร้านเจ้ภา\r\n1830กลับค่ายประจักษ์', '1000กลับกุมภวาปี\r\n1100ซื้อลูกชิ้นบ้านน้ำฆ้องกุมภวาปี\r\n1200ก๋วยเตี๋ยวร้านเจ้ภา\r\n1930กลับค่ายประจักษ์', '1200กลับกุมภวาปี\r\n1300กินส้มตำนกยูง\r\n1400กลับบ้านสวน\r\n1800กลับค่ายประจักษ์\r\n1830กินโจ๊กโนนสูง\r\n1900ถึงค่ายประจักษ์', '1000กลับกุมภวาปี\r\n1200ไปซื้อเหล็กปิยะไม่ได้ลงรถ\r\n1500เข้าบ้านแม่กุมภวาปี\r\n1800บ้านสวนกุมภวาปี\r\n1900กลับค่ายประจักษ์', '2021-04-17 13:57:53', '2021-04-17 13:57:53'),
(568, 568, '17.00เดินทางออจาก สกลนคร\r\n21.00ถึง จังหวัดขอนแก่น', 'วันที่27 อยู่บ้าน\r\n20.00 บ้านรุ่นพี่ในต.บ้านเป็ด\r\n01.00 กลับบ้าน', '28 อยู่บ้านทั้งวัน', '29 อยู่บ้าน\r\n18.00 วัดท่าบึงบ้านเป็ด\r\n18.30 กลับบ้าน', '30-2เม.ษ. อยู่บ้านทั้งวัน', '3เม.ย. งานบวช\r\n15.00 ขบวนแห่อ้อมหมู่บ้าน', '4-16 เมษา\r\n06.00 บินฑบาตร\r\n16.30 ถึงวัด\r\nอยู่วัดทั้งวัน', '17 เม.ย. \r\n09.00 ลาสิกขา\r\n10.00 ถึงบ้าน\r\n17.00 อีฟ&บอย ขอนแก่น\r\n18.00ถึงบ้าน', '18 เมษา\r\n12.30 ร้าน quinn ขอนแก่น\r\n13.00 ร้านอีฟ&บอย ขอนแก่น\r\n14.00 เดินทางออกจาก ขอนแก่น\r\n18.00 ถึงจังหวัดบ้านพัก มทบ.29 สกลนคร', NULL, NULL, NULL, NULL, NULL, '2021-04-18 13:15:02', '2021-04-18 13:15:02'),
