(571, 571, 'เดินทางกลับอุบล แวะ 7-11 มุกดาหารใส่แมสตลอด', 'ไป 7–11แบะอะเมซอลข้างโลตัสวาริน ตอนเย็นไปรับประทานอาหารร้านคอนเนอร์ที่วาริน ใสแมสตลอดยกเว้นเวลารับประทานอาหาร', 'แวะ 7-11และ อะเมซอลท่าช้าง ไปล่องแพกับญาติ', 'กลับบ้านยายที่อำเภอตระการ ไม่ได้ไปไหน', 'ไปโลตัส 7-11 และอะเมซอลปั้ม ปตท.ที่ตระการใส่เเมสตลอด เดินทางกลับวารินชำราบ', 'ไปรับประทานอาหารที่โขงเจียมและไปร้านกาแฟความทรงจำ ใส่แมสตลอดยกเว้นตอนรับประทานอาหาร', 'รับประทานอาหารเย็นที่ร้านกระต่าย ที่วารินชำราบ', 'ไป 7-11 และอะเมซอล ปตท.ข้างโลตัสวาริน ทานข้าวที่ร้านปาปิลิโอ้ เดินทางกลับสกล แวะปั้มที่อำนาจเจริญใส่แมสตลอด', NULL, NULL, NULL, NULL, NULL, NULL, '2021-04-18 15:12:35', '2021-04-18 15:12:35'),
(572, 572, 'เสาร์ที่ 10 เม.ย.64\r\n0700-0830 เดินทางสู่ อ.ส่องดาว ร่วมกับ พ.อ. ฉัตรมงคล คนขยัน และคณะ ใส่แมสตลอดการเดินทาง\r\n0830-1130 ร่วมงานอุปสมบถ ร.ต.ศาสตร์ศิลป์ ไชยพงษ์ ณ วัดโชติการาม อ.ส่องดาว จ.ว.ส.น', 'อาทิตย์ที่ 11 เม.ย.64\r\n1200 เดินทางไปทำธุรกรรมทางการเงินที่ธนาคารกรุงศรี โรบินสัน สกลนคร\r\n1230 แวะซื้อของบริเวณชั้นสอง โรบินสัน สกลนคร\r\n1245 แวะซื้อเครื่องใช้ส่วนตัว ร้านวัตสัน โรบินสัน สกลนค', 'จันทร์ที่ 12 เม.ย.64\r\n0815 เติมลม ปตท. มทบ29\r\n0820 แวะซื้อเครื่องดื่ม ปตท มทบ29\r\n0830 เติมน้ำมัน ปตท ประตูเมือง\r\n0900 เดินทางออกจากสกลนคร\r\n0945 แวะเข้าห้องน้ำ ปตท ดอนเขือง\r\n1100 เดินทางผ่านจ.', '13 เม.ย.64 พักผ่อนอยู่บ้าน รับประทานอาหารที่บ้าน ไม่ได้ออกจากบ้าน', '14 เม.ย.64\r\n1130 เดินทางออกจากบ้านเพื่อประกอบธุระส่วนตัว ร่วมกับมารดาและน้องชาย สวมแมสตลอดการเดินทาง\r\n1145 วัดต้วเพื่อตัดชุดทำงาน ร้านเงาะ(ร้านตัดสูท) อ.เมือง จ.พิษณุโลก สวมแมสตลอดการวัดต้ว\r\n', '15 เม.ย.64 \r\n0600-1700 พักผ่อนอยู่บ้าน\r\n1700-1800 เดินทางออกไปซื้ออาหาร โลตัส สาขาโคกช้าง อ.เมือง จ.พิษณุโลก ร่วมกับน้องชาย (สวมแมสตลอดเวลา)\r\n1830 รับประทานอาหารที่บ้านพักส่วนตัว\r\n1900-วันถัด', '16 เม.ย.65\r\n0000-1700 พักผ่อนบ้านพักส่วนบุคคล อ.เมือง จ.พิษณุโลก\r\n1700 แวะวัดตัว เพื่อตัดชุดร้านเงาะ (ร้านตัดสูท) อ.เมือง จ.พิษณุโลก ร่วมกับมารดา โดยรถยนต์ส่วนบุคคล (สวมแมสตลอดเวลา)\r\n1720 แวะ', '17 เม.ย.65\r\n0000-1600 พักผ่อนบ้านพักส่วนบุคคล อ.เมือง จ.พิษณุโลก\r\n1600 แวะฝากของฝากให้พี่คนรู้จัก บ้านพัก ซอยสีฟ้า อ.เมือง จ.พิษณุโลก ร่วมกับน้องชาย โดยรถยนตร์ส่วนบุคคล (สวมแมสตลอดเวลา)\r\n1630', '18 เม.ย.64\r\n1000 เดินทางสู่จว.ส.น\r\n1010 แวะเติมลมรถ ปตท.อินโดจีน อ.เมือง จ.พิษณุโลก (สวมแมสตลอดเวลา)\r\n1150 แวะเติมน้ำมัน และเครื่องดื่ม ร้านกาแฟอเมซอล ปตท.นครไทย อ.นครไทย จ.พิษณุโลก (สวมแมสตล', NULL, NULL, NULL, NULL, NULL, '2021-04-18 15:53:37', '2021-04-18 15:53:37'),
