(719, 719, '29 เม.ย.64 1900 เดินทางจากสกลนคร 2200 พักที่ ฟรอร่าฮิล จ.เลย', '30 เม.ย.64 เดินทางจาก ฟลอร่าฮิล จ.เลย ถึงบ้านแม่ฮาว เวลา 1230 จัดงานศพพ่อตาที่บ้านตนเอง ไม่ได้ไปไหน', '1 พ.ค.64 เคลื่อนศพจากบ้านไป\r\nจัดงานศพที่วัดต้นซ้อ ไม่ได้ไปไหน', '2 พ.ค.64 จัดงานศพที่วัดต้นซ้อ \r\nไม่ได้ไปไหน', '3 พ.ค. 64 จัดงานศพที่วัดต้นซ้อ เผาศพพ่อตา\r\nกลับเข้าบ้านไม่ได้ไปไหน', '4. พ.ค.64 \r\nเอารถไปเช็คแอร์ที่ศูนย์ \r\nไปซื้ออุปกรณ์ทำบ้านที่โกลบอลเฮาท์ \r\nจัดการเรื่องค่าใช้จ่ายงานศพกับญาติ\r\nไปหาปลาที่นา ทานข้าวกับญาติ', '5. พ.ค.64 เก็บกระดูกพ่อตา ทำบุญอยู่บ้านไม่ได้ไปไหน เคลียร์เรื่องงานศพ', '6 พ.ค.64 0900 -1400 เอารถเข้าศูนย์ \r\nกลับบ้าน ไม่ได้ไปไหน\r\nทานข้าวกับญาติที่บ้าน', '7 พ.ค.64 ไปซื้อไม้ทำรั้วที่นา \r\nไปซื้อยาฆ่าปลวกที่โกลบอลเฮาส์\r\nไปทำรั้วที่นา \r\nไปรับเงินฌาปนกิจที่บ้านญาติ', '8 พ.ค.64 \r\nเก็บกวาดบ้าน ขนของเข้าบ้านพี่ชาย ซื้ออุปกรณ์ไฟฟ้า ขนข้าวไปขาย\r\nทานข้าวเย็นที่บ้านตัวเองกับญาติ 8 คน', '9 พ.ค.64 \r\nเก็บของที่บ้าน \r\n1230 ทานก๋วยเตี๋ยวร้านหมูตุ๋นลุงแดง อ.ห้างฉัตร\r\n1330 เดินทางจาก จ.ลำปาง \r\nแวะเข้าห้องน้ำ ปตท.เด่นชัย\r\n2100 ถึงที่พัก au เพลส จ.เลย', '10 พ.ค.64\r\n1000 เดินทางมาจาก โรงแรม AUเพลส จ.เลย\r\n1230 แวะซื้อ kfc โลตัสอุดร(ภรรยาลงไปซื้อ)\r\n1430 ซื้อของโลตัส พรรณานิคม', NULL, NULL, '2021-05-10 11:03:36', '2021-05-10 11:03:36'),
