(146, '25', 3, 3, 2, 2, 1, 3, 3, 2, 4, 4, 4, 4, 2, 2, 2, 4, 4, 4, 4, 3, 3, 4, 4, 5, 5, 5, 5, 5, 5, 4, 3, 4, 5, 5, 5, 5, 5, 4, 5, 5, 5, 5, 5, 'ก่อนอื่นต้องขอขอบพระคุณ ผอ. และทีมผู้บริหารทุกท่าน ที่นำองค์กรและพัฒนาแก้ไขปรับปรุงองค์กรอย่างรอบด้าน ในบางครั้งการเปลี่ยนแปลง(เพื่อสิ่งที่ดีกว่าและเป็นประโยชน์ต่อ รพ.) อาจจะไม่ถูกใจใครบ้าง ซึ่งก็เป็นธรรมชาติมีคนรักก็ย่อมมีคนเกลียด เราไม่สามารถทำให้คนถูกใจได้ทุกย่าง 100% (บางครั้งก็ถูกต้องแต่ไม่ถูกใจ) ก็อย่าได้เสียใจหรือหมดกำลังใจในการทำงานนะคะ เชื่อว่าท้ายที่สุดแล้วคนเหล่านั้นจะเข้าใจถึงเหตุผลความจำเป็น ตัวเราเป็นผู้กระทำย่อมรู้ดีว่าจุดประสงค์ของการเปลี่ยนแปลงคืออะไร และทำเพื่ออะไรเป็นพอ ท้ายที่สุดนี้ขอเป็นกำลังใจให้นะคะ เหนื่อยก็พักให้หายเหนื่อย ในส่วนถัดมาขอเสนอแนะเกี่ยวกับการดึงศักยภาพบุคลากรนายทหารที่บรรจุใหม่และการมีส่วนร่วมของการปฏิบัติงานในส่วนต่างๆของ รพ.ให้มากขึ้น ไม่เช่นนั้นอาจจะทำให้บุคลากรบางกลุ่มเกิดสภาวะงานล้นมือ ยากต่อการจัดการได้อย่างทันท่วงที เนื่องจากมีปริมาณงานที่รับผิดชอบหลากหลายด้าน เกิดการกระจุกตัวของคนทำงาน ซึ่งในบางครั้งอาจนำไปสู่สภาวะ burn out ได้เช่นกัน มองอีกมุมหนึ่งถือเป็นโอกาสดีที่ผู้บริหารมอบให้ในการพัฒนาทักษะการทำงาน ผู้บริหารมองเห็นศักยภาพของผู้ปฏิบัติงาน ทั้งนี้ไม่ได้เป็นการกล่าวถึงการปฏิเสธงานแต่อย่างใด เพียงแต่อยากให้บุคลากรหน้าใหม่ๆ ได้เข้ามามีส่วนร่วมในการดำเนินภารกิจต่างๆของ รพ.เท่านั้นเองค่ะ ขอบคุณค่ะ', '2021-09-15 18:07:40', '2021-09-15 18:07:40'),
