(4, 1, 1, 1, 'ประกาศรับสมัครบุคคลพลเรือน เพื่อบรรจุเป็นลูกจ้างชั่วคราว ในตำแหน่งพนักงานช่วยการพยายาล พนักงานบริการและพนักงานขับรถ', 'ประกาศรับสมัครบุคคลพลเรือน เพื่อบรรจุเป็นลูกจ้างชั่วคราว ในตำแหน่งพนักงานช่วยการพยายาล ๒ อัตรา พนักงานบริการ ๑ อัตราและพนักงานขับรถ ๑ อัตรา ตั้แต่วันนี้ ถึงวันที่ ๙ กันยายน พ.ศ.๒๕๖๔', 'ประกาศรับสมัครพนักงานบริการ, พนักงานบิการ.pdf', '37103.pdf', '2021-08-19', '2021-08-19 11:30:27', '2021-08-19 11:31:10'),
(5, 1, 2, 1, 'ประกาศรายชื่อผู้มีสิทธิ์สอบคัดเลือกภาควิชาการ เพื่อบรรจุเป็นลูกจ้างชั่วคราว ในตำแหน่งพนักงานช่วยการพยายาล พนักงานบริการและพนักงานขับรถ', 'ประกาศรายชื่อผู้มีสิทธิ์สอบคัดเลือกภาควิชาการ เพื่อบรรจุเป็นลูกจ้างชั่วคราว ในตำแหน่งพนักงานช่วยการพยายาล พนักงานบริการและพนักงานขับรถ', 'ประกาศ มทบ.29 รายชื่อผู้มีสิทธิสอบ 15 ก.ย. 64.pdf', '56142.pdf', '2021-09-13', '2021-09-13 14:15:54', '2021-09-13 14:15:54'),
(6, 1, 3, 1, 'ประกาศผลการสอบคัดเลือกบุคคลพลเรือนเพื่อบรรจุเป็นลูกจ้างชั่วคราว ตำแหน่ง พนักงานช่วยการพยาบาล จำนวน 2 อัตรา ตำแหน่ง พนักงานบริการ จำนวน 1 อัตรา ตำแหน่ง พนักงานขับรถยนต์ จำนวน 1 อัตรา', 'ประกาศผลการสอบคัดเลือกบุคคลพลเรือนเพื่อบรรจุเป็นลูกจ้างชั่วคราว\r\nตำแหน่ง พนักงานช่วยการพยาบาล จำนวน 2 อัตรา\r\nตำแหน่ง พนักงานบริการ จำนวน 1 อัตรา\r\nตำแหน่ง พนักงานขับรถยนต์ จำนวน 1 อัตรา', 'ประกาศผลสอบ.pdf', '58975.pdf', '2021-09-23', '2021-09-23 03:52:17', '2021-09-23 03:52:17');
